import React from 'react';
import './Header.css';
import img from '../../Images/Rectangle 2.png';
export default function Header(){

    return(
        <>
          <div className="header">
                <img src={img} />
                <h2>
                Computer Engineering
                </h2>
                <p>
                142,765 Computer Engineers follow this
                </p>
                <div className="join">
                  Join Now
                </div>
          </div>
        </>
    )

}
